{
    "openapi": "3.0.0",
    "info": {
        "title": "ProcessMaker API",
        "description": "",
        "contact": {
            "email": "info@processmaker.com"
        },
        "license": {
            "name": "Apache 2.0",
            "url": "http://www.apache.org/licenses/LICENSE-2.0.html"
        },
        "version": "1.0.0"
    },
    "servers": [
        {
            "url": "/api/1.0"
        }
    ],
    "paths": {
        "/customize-ui": {
            "post": {
                "tags": [
                    "CssSettings"
                ],
                "summary": "Create or update a new setting",
                "operationId": "updateCssSetting",
                "requestBody": {
                    "required": true,
                    "content": {
                        "application/json": {
                            "schema": {
                                "properties": {
                                    "variables": {
                                        "description": "Create a new Settings css-override",
                                        "type": "string"
                                    },
                                    "sansSerifFont": {
                                        "description": "Create a new Settings css-override",
                                        "type": "string"
                                    }
                                },
                                "type": "object"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/settings"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/environment_variables": {
            "get": {
                "tags": [
                    "Environment Variables"
                ],
                "summary": "Returns all environmentVariables that the user has access to. For security, values are not included.",
                "operationId": "getEnvironmentVariables",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/filter"
                    },
                    {
                        "$ref": "#/components/parameters/order_by"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    },
                    {
                        "$ref": "#/components/parameters/include"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of environmentVariables",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Fetch a collection of variables based on paged request and filter if provided",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/EnvironmentVariable"
                                            }
                                        },
                                        "meta": {
                                            "description": "Fetch a collection of variables based on paged request and filter if provided",
                                            "type": "object"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "Environment Variables"
                ],
                "summary": "Create a new environment variable",
                "operationId": "createEnvironmentVariable",
                "requestBody": {
                    "required": true,
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/EnvironmentVariableEditable"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/EnvironmentVariable"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/environment_variables/{environment_variable_id}": {
            "get": {
                "tags": [
                    "Environment Variables"
                ],
                "summary": "Get an environment variable by id. For security, the value is not included.",
                "operationId": "getEnvironmentVariableById",
                "parameters": [
                    {
                        "name": "environment_variable_id",
                        "in": "path",
                        "description": "ID of environment_variables to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "201": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/EnvironmentVariable"
                                }
                            }
                        }
                    }
                }
            },
            "put": {
                "tags": [
                    "Environment Variables"
                ],
                "summary": "Update an environment variable",
                "operationId": "updateEnvironmentVariable",
                "parameters": [
                    {
                        "name": "environment_variable_id",
                        "in": "path",
                        "description": "ID of environment variables to update",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "requestBody": {
                    "required": true,
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/EnvironmentVariableEditable"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/EnvironmentVariable"
                                }
                            }
                        }
                    }
                }
            },
            "delete": {
                "tags": [
                    "Environment Variables"
                ],
                "summary": "Delete an environment variable",
                "operationId": "deleteEnvironmentVariable",
                "parameters": [
                    {
                        "name": "environment_variable_id",
                        "in": "path",
                        "description": "ID of environment_variables to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "success"
                    }
                }
            }
        },
        "/files": {
            "get": {
                "tags": [
                    "Files"
                ],
                "summary": "Returns the list of files",
                "operationId": "getFiles",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/filter"
                    },
                    {
                        "$ref": "#/components/parameters/order_by"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of files",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display a listing of the resource.",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/media"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "Files"
                ],
                "summary": "Save a new media file. Note: To upload files to a request, use createRequestFile in the RequestFile API",
                "operationId": "createFile",
                "parameters": [
                    {
                        "name": "model_id",
                        "in": "query",
                        "description": "ID of the model to which the file will be associated",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    },
                    {
                        "name": "model",
                        "in": "query",
                        "description": "Full namespaced class of the model to associate",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "name": "data_name",
                        "in": "query",
                        "description": "Name of the variable used in a request",
                        "required": false,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "name": "collection",
                        "in": "query",
                        "description": "Media collection name. For requests, use 'default'",
                        "required": false,
                        "schema": {
                            "type": "string"
                        }
                    }
                ],
                "requestBody": {
                    "required": true,
                    "content": {
                        "multipart/form-data": {
                            "schema": {
                                "properties": {
                                    "file": {
                                        "description": "save a new media file",
                                        "type": "string",
                                        "format": "binary"
                                    }
                                },
                                "type": "object"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "id": {
                                            "description": "Store a newly created resource in storage.",
                                            "type": "string"
                                        },
                                        "model_id": {
                                            "description": "Store a newly created resource in storage.",
                                            "type": "string"
                                        },
                                        "file_name": {
                                            "description": "Store a newly created resource in storage.",
                                            "type": "string"
                                        },
                                        "mime_type": {
                                            "description": "Store a newly created resource in storage.",
                                            "type": "string"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/files/{file_id}": {
            "get": {
                "tags": [
                    "Files"
                ],
                "summary": "Get the metadata of a file. To actually fetch the file see Get File Contents",
                "operationId": "getFileById",
                "parameters": [
                    {
                        "name": "file_id",
                        "in": "path",
                        "description": "ID of the file to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Successfully found the file",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/media"
                                }
                            }
                        }
                    },
                    "404": {
                        "$ref": "#/components/responses/404"
                    }
                }
            },
            "delete": {
                "tags": [
                    "Files"
                ],
                "summary": "Delete a media file",
                "operationId": "deleteFile",
                "parameters": [
                    {
                        "name": "file_id",
                        "in": "path",
                        "description": "ID of the file",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "204": {
                        "description": "success"
                    },
                    "404": {
                        "$ref": "#/components/responses/404"
                    }
                }
            }
        },
        "/files/{file_id}/contents": {
            "get": {
                "tags": [
                    "Files"
                ],
                "summary": "Get the contents of a file",
                "operationId": "getFileContentsById",
                "parameters": [
                    {
                        "name": "file_id",
                        "in": "path",
                        "description": "ID of the file to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "File stream",
                        "content": {
                            "application/octet-stream": {
                                "schema": {
                                    "type": "string",
                                    "format": "binary"
                                }
                            }
                        }
                    },
                    "404": {
                        "$ref": "#/components/responses/404"
                    }
                }
            }
        },
        "/groups": {
            "get": {
                "tags": [
                    "Groups"
                ],
                "summary": "Returns all groups that the user has access to",
                "operationId": "getGroups",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/status"
                    },
                    {
                        "$ref": "#/components/parameters/filter"
                    },
                    {
                        "$ref": "#/components/parameters/order_by"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    },
                    {
                        "$ref": "#/components/parameters/include"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of groups",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display a listing of the resource.",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/groups"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "Groups"
                ],
                "summary": "Save a new group",
                "operationId": "createGroup",
                "requestBody": {
                    "required": true,
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/groupsEditable"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/groups"
                                }
                            }
                        }
                    },
                    "422": {
                        "$ref": "#/components/responses/422"
                    }
                }
            }
        },
        "/groups/{group_id}": {
            "get": {
                "tags": [
                    "Groups"
                ],
                "summary": "Get single group by ID",
                "operationId": "getGroupById",
                "parameters": [
                    {
                        "name": "group_id",
                        "in": "path",
                        "description": "ID of group to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Successfully found the group",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/groups"
                                }
                            }
                        }
                    },
                    "404": {
                        "$ref": "#/components/responses/404"
                    }
                }
            },
            "put": {
                "tags": [
                    "Groups"
                ],
                "summary": "Update a group",
                "operationId": "updateGroup",
                "parameters": [
                    {
                        "name": "group_id",
                        "in": "path",
                        "description": "ID of group to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "requestBody": {
                    "required": true,
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/groupsEditable"
                            }
                        }
                    }
                },
                "responses": {
                    "204": {
                        "description": "success"
                    },
                    "404": {
                        "$ref": "#/components/responses/404"
                    }
                }
            },
            "delete": {
                "tags": [
                    "Groups"
                ],
                "summary": "Delete a group",
                "operationId": "deleteGroup",
                "parameters": [
                    {
                        "name": "group_id",
                        "in": "path",
                        "description": "ID of group to return",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "204": {
                        "description": "success"
                    },
                    "404": {
                        "$ref": "#/components/responses/404"
                    }
                }
            }
        },
        "/groups/{group_id}/users": {
            "get": {
                "tags": [
                    "Groups"
                ],
                "summary": "Returns all users of a group",
                "operationId": "getGroupUsers",
                "parameters": [
                    {
                        "name": "group_id",
                        "in": "path",
                        "description": "ID of group",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    },
                    {
                        "$ref": "#/components/parameters/filter"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of members of a group",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display the list of users in a group",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/users"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/groups/{group_id}/groups": {
            "get": {
                "tags": [
                    "Groups"
                ],
                "summary": "Returns all users of a group",
                "operationId": "getGroupGroupss",
                "parameters": [
                    {
                        "name": "group_id",
                        "in": "path",
                        "description": "ID of group",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    },
                    {
                        "$ref": "#/components/parameters/filter"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of members of a group",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display the list of groups in a group",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/groups"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/group_members": {
            "get": {
                "tags": [
                    "Group Members"
                ],
                "summary": "Returns all groups for a given member",
                "operationId": "getGroupMembers",
                "parameters": [
                    {
                        "$ref": "#/components/parameters/member_id"
                    },
                    {
                        "$ref": "#/components/parameters/order_by"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of group_members",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display a listing of the resource.",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/groupMembers"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            },
            "post": {
                "tags": [
                    "Group Members"
                ],
                "summary": "Save a new group member",
                "operationId": "createGroupMember",
                "requestBody": {
                    "required": true,
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/groupMembersEditable"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "success",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/createGroupMembers"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/group_members/{group_member_id}": {
            "get": {
                "tags": [
                    "Group Members"
                ],
                "summary": "Get single group member by ID",
                "operationId": "getGroupMemberById",
                "parameters": [
                    {
                        "name": "group_member_id",
                        "in": "path",
                        "description": "ID of group members to return",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Successfully found the group members",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/getGroupMembersById"
                                }
                            }
                        }
                    }
                }
            },
            "delete": {
                "tags": [
                    "Group Members"
                ],
                "summary": "Delete a group member",
                "operationId": "deleteGroupMember",
                "parameters": [
                    {
                        "name": "group_member_id",
                        "in": "path",
                        "description": "ID of group_members to return",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    }
                ],
                "responses": {
                    "204": {
                        "description": "success"
                    }
                }
            }
        },
        "/group_members_available": {
            "get": {
                "tags": [
                    "Group Members"
                ],
                "summary": "Returns all groups available for a given member",
                "operationId": "getGroupMembersAvailable",
                "parameters": [
                    {
                        "name": "member_id",
                        "in": "path",
                        "description": "ID of group member to return",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "name": "member_type",
                        "in": "path",
                        "description": "type of group member to return",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "$ref": "#/components/parameters/filter"
                    },
                    {
                        "$ref": "#/components/parameters/order_by"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of groups available to be assigned as member",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display a listing of groups available",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/availableGroupMembers"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/user_members_available": {
            "get": {
                "tags": [
                    "Group Members"
                ],
                "summary": "Returns all users available for a given group",
                "operationId": "getUserMembersAvailable",
                "parameters": [
                    {
                        "name": "group_id",
                        "in": "path",
                        "description": "ID of group to return",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "name": "filter",
                        "in": "query",
                        "description": "Filter results by string. Searches Name. Can be a substring.",
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "$ref": "#/components/parameters/order_by"
                    },
                    {
                        "$ref": "#/components/parameters/order_direction"
                    },
                    {
                        "$ref": "#/components/parameters/per_page"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "list of users available to be assigned as member",
                        "content": {
                            "application/json": {
                                "schema": {
                                    "properties": {
                                        "data": {
                                            "description": "Display a listing of users available",
                                            "type": "array",
                                            "items": {
                                                "$ref": "#/components/schemas/users"
                                            }
                                        },
                                        "meta": {
                                            "$ref": "#/components/schemas/metadata"
                                        }
                                    },
                                    "type": "object"
                                }
                            }
                        }
                    }
                }
            }
        },
        "/notifications": {
            "get": {
                "tags": [
                    "Notifications"
                ],
                "summary": "Returns all notifications that the user has access to",
                "operationId": "getNotifications",
                "parameters": [
                    {
                        "name": "status",
                        "in": "query",
                        "description": "Only return notifications by status (unread, all, etc.)",
                        "required": false,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "$ref": "#/components/parameters/filter"
